import React, {Component} from 'react';
import './Projects.css';
import $ from 'jquery';

class Projects extends Component{
    render() {
        return(
            <div className="container">
                <div className="row">
                    <div className="gallery col-lg-12 col-md-12 col-sm-12 col-xs-12">
                        <h1 className="gallery-title">Gallery</h1>
                    </div>

                    <div align="center">
                        <button className="btn btn-default filter-button" data-filter="all">All</button>
                        <button className="btn btn-default filter-button" data-filter="hdpe">HDPE Pipes</button>
                        <button className="btn btn-default filter-button" data-filter="sprinkle">Sprinkle Pipes</button>
                        <button className="btn btn-default filter-button" data-filter="spray">Spray Nozzle</button>
                        <button className="btn btn-default filter-button" data-filter="irrigation">Irrigation Pipes
                        </button>
                    </div>
                    <br/>


                    <div className="gallery_product col-lg-4 col-md-4 col-sm-4 col-xs-6 filter hdpe">
                        <img src="http://fakeimg.pl/365x365/" className="img-responsive"/>
                    </div>

                    <div className="gallery_product col-lg-4 col-md-4 col-sm-4 col-xs-6 filter sprinkle">
                        <img src="http://fakeimg.pl/365x365/" className="img-responsive"/>
                    </div>

                    <div className="gallery_product col-lg-4 col-md-4 col-sm-4 col-xs-6 filter hdpe">
                        <img src="http://fakeimg.pl/365x365/" className="img-responsive"/>
                    </div>

                    <div className="gallery_product col-lg-4 col-md-4 col-sm-4 col-xs-6 filter irrigation">
                        <img src="http://fakeimg.pl/365x365/" className="img-responsive"/>
                    </div>

                    <div className="gallery_product col-lg-4 col-md-4 col-sm-4 col-xs-6 filter spray">
                        <img src="http://fakeimg.pl/365x365/" className="img-responsive"/>
                    </div>

                    <div className="gallery_product col-lg-4 col-md-4 col-sm-4 col-xs-6 filter irrigation">
                        <img src="http://fakeimg.pl/365x365/" className="img-responsive"/>
                    </div>

                    <div className="gallery_product col-lg-4 col-md-4 col-sm-4 col-xs-6 filter spray">
                        <img src="http://fakeimg.pl/365x365/" className="img-responsive"/>
                    </div>

                    <div className="gallery_product col-lg-4 col-md-4 col-sm-4 col-xs-6 filter irrigation">
                        <img src="http://fakeimg.pl/365x365/" className="img-responsive"/>
                    </div>

                    <div className="gallery_product col-lg-4 col-md-4 col-sm-4 col-xs-6 filter irrigation">
                        <img src="http://fakeimg.pl/365x365/" className="img-responsive"/>
                    </div>

                    <div className="gallery_product col-lg-4 col-md-4 col-sm-4 col-xs-6 filter hdpe">
                        <img src="http://fakeimg.pl/365x365/" className="img-responsive"/>
                    </div>

                    <div className="gallery_product col-lg-4 col-md-4 col-sm-4 col-xs-6 filter spray">
                        <img src="http://fakeimg.pl/365x365/" className="img-responsive"/>
                    </div>

                    <div className="gallery_product col-lg-4 col-md-4 col-sm-4 col-xs-6 filter sprinkle">
                        <img src="http://fakeimg.pl/365x365/" className="img-responsive"/>
                    </div>
                </div>
            </div>
        )
    }
    }

$(document).ready(function () {

    $(".filter-button").click(function () {
        var value = $(this).attr('data-filter');

        if (value == "all") {
          //$('.filter').removeClass('hidden');
            $('.filter').show('1000');

        }
        else {

//                $('.filter[filter-item="'+value+'"]').removeClass('hidden');
//                $(".filter").not('.filter[filter-item="'+value+'"]').addClass('hidden');
            $(".filter").not('.'+value).hide('3000');
            $(".filter").filter('.'+value).show('3000');
        }

    });

    if ($(".filter-button").removeClass("active")) {
        $(this).removeClass("active");
    }
    $(this).addClass("active");

});

export default Projects;
